import React, { Component } from 'react';

import './App.css';



function App(props){
  return(
    <div className="App">
        <h1>Title</h1>
        <p>This is the blog post paragraph</p>
        <p>{props.comment.text}</p>
        <p>{props.comment.author.name}</p>
      </div>
  )
}
export default App;
